a\\language\\en-US\\en-US.mod_languages.ini'),(1771,'MOD_LANGUAGES_FIELD_USEIMAGE_LABEL','Use Image Flags','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_languages.ini'),(1772,'MOD_LANGUAGES_OPTION_DEFAULT_LANGUAGE','Default','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_languages.ini'),(1773,'MOD_LANGUAGES_SPACERDROP_LABEL','<u>If Use Dropdown is set to \'Yes\', <br />the display options below will be ignored</u>','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_languages.ini'),(1774,'MOD_LANGUAGES_SPACERNAME_LABEL','<u>If Use Image Flags is set to \'Yes\', <br />the display options below will be ignored</u>','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_languages.ini'),(1775,'MOD_LANGUAGES_XML_DESCRIPTION','This module displays a list of available Content Languages (as defined and published in Language Manager Content tab) for switching between them when one wants to use Joomla! as a multilingual site. <br />--The plugin \'System - Language Filter\' has to be enabled.--<br /> When switching languages and if the item displayed in the page is not associated to another item, the module redirects to the Home page defined for the chosen language.<br /> Otherwise, if the parameter is set for the Language filter plugin, it will redirect to the associated item in the language chosen. Thereafter, the navigation will be the one defined for that language. <br />If the plugin <strong>\'System - Language Filter\'</strong> is disabled, this may have unwanted results.<br /><strong>Method:</strong><br />1. Open Language Manager Content tab and make sure the Languages you want to use in contents are published and have a Language Code for the URL as well as prefix for the image used in the module display.<br />2. Create a Home page by assigning a language to a menu item and defining it as Default Home page for each published content language. <br />  3. Thereafter, you can assign a language to any Article, Category, Module, Newsfeed, Weblinks in Joomla.<br /> 4. Make sure the module is published and the plugin is enabled. <br /> 5. When using associated items, make sure the module is displayed on the pages concerned. <br />6. The way the flags or names of the languages are displayed is defined by the ordering in the Language Manager - Content Languages.<br ><br >If this module is published, it is suggested to publish the administrator multilingual status module.','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_languages.ini'),(1776,'MOD_LANGUAGES','Language Switcher','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_languages.sys.ini'),(1777,'MOD_LANGUAGES_LAYOUT_DEFAULT','Default','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_languages.sys.ini'),(1778,'MOD_LANGUAGES_XML_DESCRIPTION','This module displays a list of available Content Languages (as defined and published in Language Manager Content tab) for switching between them when one wants to use Joomla! as a multilingual site. <br />--The plugin \'System - Language Filter\' has to be enabled.--<br /> When switching languages and if the item displayed in the page is not associated to another item, the module redirects to the Home page defined for the chosen language.<br /> Otherwise, if the parameter is set for the Language filter plugin, it will redirect to the associated item in the language chosen. Thereafter, the navigation will be the one defined for that language. <br />If the plugin <strong>\'System - Language Filter\'</strong> is disabled, this may have unwanted results.<br /><strong>Method:</strong><br />1. Open Language Manager Content tab and make sure the Languages you want to use in contents are published and have a Language Code for the URL as well as prefix for the image used in the module display.<br />2. Create a Home page by assigning a language to a menu item and defining it as Default Home page for each published content language. <br />  3. Thereafter, you can assign a language to any Article, Category, Module, Newsfeed, Weblinks in Joomla.<br /> 4. Make sure the module is published and the plugin is enabled. <br /> 5. When using associated items, make sure the module is displayed on the pages concerned. <br />6. The way the flags or names of the languages are displayed is defined by the ordering in the Language Manager - Content Languages.<br ><br >If this module is published, it is suggested to publish the administrator multilingual status module.','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_languages.sys.ini'),(1779,'MOD_LOGIN','Login','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_login.ini'),(1780,'MOD_LOGIN_FIELD_GREETING_DESC','Show/Hide the simple greeting text','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_login.ini'),(1781,'MOD_LOGIN_FIELD_GREETING_LABEL','Show Greeting','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_login.ini'),(1782,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_DESC','Select the page the user will be redirected to after a successful login. Select from all the pages listed in the dropdown menu. Choosing \"Default\" will return to the same page.','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_login.ini'),(1783,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_LABEL','Login Redirection Page','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_login.ini'),(1784,'MOD_LOGIN_FIELD_LOGOUT_REDIRECTURL_DESC','Select the page the user will be redirected to after successfully ending their current session by logging out. Select from all the pages listed in the dropdown menu. Choosing \"Default\" will return to the same page.','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_login.ini'),(1785,'MOD_LOGIN_FIELD_LOGOUT_REDIRECTURL_LABEL','Logout Redirection Page','C:\\Users\\ldina\\code\\CMS\\corba\\language\\en-US\\en-US.mod_login.ini'),(1786,'MOD_LOGIN_FIELD_NAME_DESC','Displays name or username after logging','C:\